  return (
    <div className="side-bar-header-wrapper">
      <div className="side-bar-header-upper">
        <h1 className="side-bar-header-title">Chats</h1>
        <div>
          <Add />
        </div>
        <div></div>
      </div>
      <SideBarSearchInput />
    </div>
  );
};

export default SideBarHeader;
